import ReactDOM from 'react-dom';
import add from './App'

ReactDOM.render(
    <>
    <ol>
        <li>Addition of These Two Number is {add(40,20)} </li>
        <li>Substration of These Two Number is </li>
        <li>Multiply of These Two Number is </li>
        <li>Divide of These Two Number is </li>
    </ol>
    </>,document.getElementById("root")
);
